  navigate(MAIN_PATH());
}

//          component: 검색 버튼          //
const SearchButton = () => {

//          render: 검색 버튼           //

  return(
    <div className='icon-button'>
      <div className='icon search-light-icon'> </div></div>
  
  )
}

//           render: Header          //
